const spec = require('./targetspec.json')

const flow = spec.flow

let resolver = null

const botui = {
  show: (text = '') => {
    return new Promise((resolve) => {
      console.log(text)
      resolve()
    })
  },
  wait: (time = 0) => {
    return new Promise((resolve) => {
      resolver = resolve
      setTimeout(resolve, time)
    })
  },
  input: (text = '') => {
    return new Promise((resolve) => {
      resolver = resolve
      console.log(text)
    })
  },
  next: (...args) => {
    resolver(...args)
  }
}

